	(135,0,'de_DE','static','home.faq.A.question','Was ist evulpo?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(136,0,'de_DE','static','home.faq.A.answer','evulpo ist eine kostenlose Lernplattform. Die Plattform bietet unzählige Erklärvideos, Zusammenfassungen und Übungseinheiten für lehrplanrelevante Schulthemen. Sie eignet sich für alle Schüler*innen ab der 3. Grundschulstufe, sowie alle Gymnasial-, Real- und MIttelschulstufen. Zudem bietet evulpo Eltern- und Lehrpersonenzugänge.','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
