	(211,0,'de_DE','static','exampreps.headlineA','Vorbereitung auf die','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(212,0,'de_DE','static','exampreps.headlineB','Aufnahmeprüfung','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(213,0,'de_DE','static','exampreps.intro.title','Kostenlose Hilfe zur optimalen Prüfungsvorbereitung','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(214,0,'de_DE','static','exampreps.intro.text','Steht eine Aufnahmeprüfung an? Wird für\ndie Vorbereitung auf den Prüfungsstoff gute Unterstützung gebraucht?\nMit evulpo können sich Prüflinge kostenlos auf die große Aufnahmeprüfung vorbereiten und sind so bestens gewappnet für den großen Tag.','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(215,0,'de_DE','static','exampreps.details.title','Auf die Prüfung abgestimmtes Lernmaterial','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(216,0,'de_DE','static','exampreps.details.text','Die Erklärvideos, Zusammenfassungen und Übungen sind strengstens an den offiziellen Prüfungsstoff angepasst. Zu finden ist also hilfreiches Unterrichtsmaterial zu genau denjenigen Mathe-, Deutsch-, Französisch- oder Englischthemen, die für das Bestehen Deiner Prüfung besonders wichtig. sind.','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(217,0,'de_DE','static','faq.headlineA','Fragen und Antworten','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(218,0,'de_DE','static','faq.introA','Hast Du noch Fragen zu evulpo?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(219,0,'de_DE','static','faq.introB','Hier beantworten wir die häufigsten Fragen zu unserer Lernplattform. Bei weiteren Fragen steht unserer Support jederzeit zur Verfügung.','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(220,0,'de_DE','static','faq.mainTitle','FAQ – Häufige Fragen und Antworten','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(221,0,'de_DE','static','faq.A.question','Was ist evulpo?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(222,0,'de_DE','static','faq.A.answer','evulpo ist eine kostenlose Lernplattform. Die Plattform bietet unzählige Erklärvideos, Zusammenfassungen und Übungseinheiten für lehrplanrelevante Schulthemen. Sie eignet sich für alle Schüler*innen ab der 3. Grundschulstufe, sowie alle Gymnasial-, Real- und MIttelschulstufen. Zudem bietet evulpo Eltern- und Lehrpersonenzugänge.','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(223,0,'de_DE','static','faq.B.question','Ist evulpo wirklich kostenlos?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(224,0,'de_DE','static','faq.C.question','Wie kann ich mich auf evulpo registrieren?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(225,0,'de_DE','static','faq.C.answer','Vorneweg: Du musst Dich auf evulpo nicht registrieren – Du kannst die Lernplattform auch einfach so benutzen. Falls Du dich registrieren möchtest, damit zum Beispiel deine Lernfortschritte gespeichert werden, so kannst Du Dich ganz einfach mit Hilfe einer E-Mail-Adresse und eines Passworts registrieren. Vergiss nicht, in Deinem Spam Ordner nachzuschauen, falls Du die Registrierungsmail nicht erhalten hast.','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(226,0,'de_DE','static','faq.D.question','Wieso soll ich mich registrieren?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(227,0,'de_DE','static','faq.E.question','Was muss ich tun, wenn ich meine Zugangsdaten verloren habe?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(228,0,'de_DE','static','faq.F.question','Gibt es auf evulpo auch einen Zugang für Eltern?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(229,0,'de_DE','static','faq.G.question','Wie kann ich als Elternteil meine Kinder einschreiben?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(230,0,'de_DE','static','faq.G.answer','Du musst Dich ganz einfach als Elternteil registrieren. Danach klickst Du zuerst auf “Gruppe” und dann auf “Plus” (neue Gruppe erstellen). Hier kannst Du Deine Kinder registrieren sowie das Bundesland und die Schulstufe auswählen.','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(231,0,'de_DE','static','faq.H.question','Gibt es auf evulpo auch einen Zugang für Lehrpersonen?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
	(232,0,'de_DE','static','faq.I.question','Wie kann ich als Lehrer meine Schulklasse einschreiben?','2022-08-20 10:35:09','2022-08-20 10:35:09',5),
