	(949,0,'de_DE','static','vision.finance.title','Bildung - zugänglich für alle','2022-08-20 10:35:09','2022-08-25 13:48:12',5),
	(950,0,'de_DE','static','vision.finance.text','Hinter dem Projekt von evulpo steht die Überzeugung, dass Bildung für alle zugänglich sein soll. Diese Überzeugung bildet sozusagen die Basis der Lernwelt. So hat sich das evulpo-Team auch entschieden, dass der Grundzugang zur evulpo-Lernwelt kostenlos ist. Zudem ist das kostenpflichtige Produkt in dieser Lernwelt, namentlich \"evulpo unlimited\", sehr günstig. Für einen kleinen Preis erhält man einen unlimitierten Zugang zur Lernwelt von evulpo.','2022-08-20 10:35:09','2022-08-25 13:47:51',5),
