	(1152,0,'de_DE','static','faq.J.question','Was ist, wenn ich trotz des Lernmaterials von evulpo noch Fragen zum Schulstoff habe?','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1153,0,'de_DE','static','faq.J.answer','Wenn du trotz des Lernmaterials von evulpo noch Fragen zum Schulstoff hast, so kannst du diese Fragen meist beantworten, indem du die evulpo-Materialien ein zweites (oder ein drittes) Mal anschaust.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1154,0,'de_DE','static','faq.K.question','Was ist, wenn ein Schulthema von evulpo nicht abgedeckt wird?','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1155,0,'de_DE','static','faq.K.answer','Dann freut sich evulpo, wenn du uns mitteilst, dass du gerne Lernmaterial zu einem spezifischen Thema möchtest! Wir erweitern das Angebot laufend. Es kommen also stetig neue Lernmaterialien hinzu, insbesondere zu jenen Themen, welche die Nutzer*innen der Lernplattform vermissen. ☺ Du kannst gerne unser Support-Team kontaktieren : info_de@evulpo.com','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1156,0,'de_DE','static','faq.L.question','Ich finde ein Thema nicht.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1157,0,'de_DE','static','faq.L.answer','Auf evulpo gibt es eine Fülle von Lernmaterial. Unsere Inhalte sind am Lehrplan angepasst und sollten alle lehrplanrelevanten Themen abdecken. Lehrer besitzen eine gewisse Freiheit und dürfen relativ frei entscheiden, wann sie welche Themen behandeln. Manchmal findest Du deshalb ein Thema auf einer anderen Schulstufe. Wir empfehlen Dir, ein bisschen durch unsere Inhalte zu stöbern. Falls Du ein Thema trotzdem nicht findest, melde dich bei unserem Support-Team unter info_de@evulpo.com - wir helfen gerne weiter.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1158,0,'de_DE','static','faq.M.question','Ein Inhalt wird nicht angezeigt, was tun?','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1159,0,'de_DE','static','faq.M.answer','Mit einem so hohen Lernangebot kann es manchmal passieren, dass ein Fehler auftritt. Dies kann diverse Gründe haben und an verschiedenen Stellen auftreten. Melde die Fehlermeldung unserem Support-Team zusammen mit dem Link der Seite. Wir werden den Fehler anschließend so schnell wie möglich beheben.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1160,0,'de_DE','static','faq.N.question','Wie kann ich die Schulstufe ändern?','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1161,0,'de_DE','static','faq.N.answer','Die Schulstufe kannst du unter Einstellungen deines Benutzerkontos ändern.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1162,0,'de_DE','static','faq.O.question','Wie finanziert sich evulpo?','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1163,0,'de_DE','static','faq.O.answer','Evulpo hat dank einer guten Investorenrunde genügend Mittel, um die Lernplattform kostenlos anzubieten. Schon bald wird es auch Premium-Accounts geben, welche zwar einen kleinen Betrag kosten, aber auch einen grossen Mehrwert bieten werden. Diesbezüglich halten wir Dich auf dem Laufenden. Natürlich wirst du die Plattform auch weiterhin kostenlos nutzen können.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1164,0,'de_DE','dashboard','groups.pleaseEnterUserEmails','Bitte Benutzer-E-Mails eingeben','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
