	(1504,0,'de_DE','static','vision.idea.text','Hilfe beim Schulstoff. Immer. Überall. Und für alle. Um dies geht es bei evulpo: Alle Schüler*innen sollen auf sie zugeschnittene Hilfe beim für sie wichtigen Schulstoff erhalten. Dies immer – auch nach dem Ende eines Schultages. Dies überall – auch auf dem Weg ins Schulzimmer. Und dies ohne Ausnahme – der gerade erst nach Deutschland gezogene Drittklässler soll ebenso ein passendes Angebot erhalten wie die bald schon in ein Studium wechselnde Abiturientin.','2022-08-20 10:35:10','2022-08-25 12:35:13',5),
