	(1526,0,'de_DE','single','Customer Accounts Overview','single.Customer Accounts Overview','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1527,0,'de_DE','static','home.faq.D.answer','Ja, evulpo ist wirklich kostenlos! ☺ Dank einer guten Investorenrunde haben wir genügend Mittel, um die Lernplattform kostenlos anzubieten. Im Laufe der Zeit wird es zum Beispiel Premium-Accounts geben, welche zwar einen kleinen Betrag kosten, aber auch einen großen Mehrwert bieten werden. Auch kann man bald Video-Call-Nachhilfe buchen, wobei es dann die Möglichkeit gibt, sich per Call mit einer klugen Nachhilfe-Lehrperson zu verbinden.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1528,0,'de_DE','static','home.faq.E.answer','evulpo hat dank einer guten Investorenrunde genügend Mittel, um die Lernplattform kostenlos anzubieten. Im Laufe der Zeit wird es zum Beispiel Premium-Accounts geben, welche zwar einen kleinen Betrag kosten, aber auch einen grossen Mehrwert bieten werden. Diesbezüglich halten wir dich auf dem Laufenden.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1529,0,'de_DE','static','home.languages.title','Länder:','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1530,0,'de_DE','static','home.languages.german','Deutschschweiz','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1531,0,'de_DE','static','home.languages.french','Romandie','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1532,0,'de_DE','static','faq.D.answer','Wenn du dich auf evulpo registrierst, kannst Du unsere Lernwelt mit vielen tollen Zusätzen benutzen. Zum Beispiel kannst Du Abzeichen sammeln und Dein Lernfortschritt wird laufend gespeichert. So kannst Du mit dem Lernen dort fortsetzen, wo Du aufgehört hast! Du kannst auch Lerngruppen kreieren oder Gruppen beitreten. Also verliere keine Zeit und schreibe Dich schnell ein!','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1533,0,'de_DE','static','faq.E.answer','Du klickst dabei einfach auf \"Passwort zurücksetzen\" und kannst daraufhin in wenigen Schritten ein neues, Dir den Zugang zur Plattform sicherndes Passwort erstellen.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1534,0,'de_DE','static','faq.F.answer','Ja, auf evulpo gibt es auch einen Zugang für Eltern. Viele Eltern benutzen evulpo, um kostenlos etwa an hilfreiche Zusammenfassungen zu kommen oder um den Lernfortschritt Deiner Kinder zu sehen. Mit evulpo können Deine Kinder bequem ausserhalb der Schule weiterlernen oder sich auf Prüfungen vorbereiten.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1535,0,'de_DE','static','faq.H.answer','Ja, auf evulpo gibt es auch einen Zugang für Lehrpersonen. Etliche Lehrpersonen benutzen evulpo, um kostenlos beispielsweise an nützliche Übungseinheiten zu kommen und den Lernfortschritt der Schüler zu sehen.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1536,0,'de_DE','static','faq.I.answer','Als Lehrer kannst Du eine Gruppe für die ganze Schulklasse erstellen. Dabei klickst Du auf “Gruppe” und dann “Plus” (so erstellst Du eine neue Gruppe). Hier kannst Du alle Deine Schüler*innen registrieren sowie den Kanton und die Schulstufe auswählen.','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1537,0,'de_DE','static','team.header','250 Füxe für 1 Lernplattform','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1538,0,'de_DE','static','team.text','250 schlaue Köpfe arbeiten am Aufbau der Lernplattform von evulpo. Das Ziel: Bau der besten, größten und coolsten Lernwelt Europas - hilfreich für Schüler*innen auf dem ganzen Kontinent. Für evulpo-Deutschland sind rund 100 Schlaumeier zuständig. :)','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1539,0,'de_DE','dashboard','home.body.extras-de-fr.title','Wir wollen auch von Dir lernen!','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1540,0,'de_DE','dashboard','home.body.extras-de-fr.text','Hast Du Vorschläge, was wir auf evulpo noch besser machen können? Auch wir lernen jeden Tag gerne mehr dazu und freuen uns auf Dein Feedback!','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
