	(1834,0,'de_DE','static','static.premium.faq.title','FAQ Title','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1835,0,'de_DE','static','static.premium.faq.a.question','Question A','2022-08-20 10:35:10','2022-08-20 10:35:10',5),
	(1836,0,'de_DE','static','premium.faq.a.answer','Ja, Du kannst evulpo unlimited jederzeit kündigen. Direkt nach der Kündigung wird also nichts mehr von der Kreditkarte abgebucht.','2022-08-20 10:35:10','2022-08-23 12:41:19',5),
	(1837,0,'de_DE','static','premium.faq.b.question','Wie kann ich Freunden/Familienmitgliedern einen unlimitierten Zugang geben?','2022-08-20 10:35:10','2022-08-23 12:41:25',5),
	(1838,0,'de_DE','static','premium.faq.b.answer','Mach ein evulpo unlimited Upgrade, damit du einer weiterer oder mehreren Personen einen Zugang zu evulpo unlimited besorgen kannst. Nach dem Upgrade kannst Du Deine Freunde/Familienmitglieder in Deine unlimited Gruppe hinzufügen.','2022-08-20 10:35:10','2022-08-23 12:41:30',5),
	(1839,0,'de_DE','static','premium.faq.c.question','Ich habe evulpo unlimited nur für 1 Person, kann ich eine zusätzliche Person zu einem späteren Zeitpunkt hinzufügen?','2022-08-20 10:35:10','2022-08-23 12:41:35',5),
	(1840,0,'de_DE','static','premium.faq.c.answer','Ja, klar. Du kannst evulpo unlimited jederzeit upgraden und so auch nachträglich ermöglichen, dass weitere Personen einen Zugang zu evulpo unlimited erhalten.','2022-08-20 10:35:10','2022-08-23 12:41:42',5),
	(1841,0,'de_DE','static','premium.faq.d.question','Wie kann ich eine Video-Call-Nachhilfeeinheit buchen?','2022-08-20 10:35:10','2022-08-23 12:41:47',5),
	(1842,0,'de_DE','static','premium.faq.d.answer','Einen Video-Call-Nachhilfeeinheit kannst Du buchen, indem Du Dir entweder einen Credit (für eine Einheit) oder mehrere Credits (für mehrere Einheiten) kaufst. Pro Einheit zu je 50 Minuten brauchst Du einen Credit.','2022-08-20 10:35:10','2022-08-23 12:41:52',5),
	(1843,0,'de_DE','static','premium.faq.e.question','Was erhalte ich durch eine Video-Call-Nachhilfeeinheit?','2022-08-20 10:35:10','2022-08-23 12:41:58',5),
	(1844,0,'de_DE','static','premium.faq.e.answer','Durch eine Video-Call-Nachhilfeeinheit bekommst Du eine 50 Minuten andauernde Nachhilfeeinheit mit einer tollen Lehrperson. Wenn Du also eine Nachhilfeeinheit kaufst, so bekommst Du eine individuelle, auf Dich zugeschnittene Unterstützung durch eine Lehrperson.','2022-08-20 10:35:10','2022-08-23 12:42:04',5),
