	(2316,0,'de_DE','report','motivationquote.body.0','Um die tolle Aussicht genießen zu können, muss man den Berg erst einmal besteigen. Auch wenn das vereinzelt zu Schnappatmung und Tomatengesicht führen kann. Das Tolle daran: Je öfter ein Berg bestiegen wird, desto leicht wird es.','2022-08-25 13:39:51','2022-08-25 13:44:09',5),
