	(2325,0,'de_DE','lptcontroller','region.text_yellow','Die Lektionen sind auf die offiziellen Lehrplän der Bundesländer abgestimmt. Evulpo bietet Erklärvideos, Zusammenfassungen und Übungen in Mathematik, Französisch und Englisch. Das Angebot ist kostenlos und sorgt dafür, dass alle Schüler:innen ab der vierten Klasse jederzeit und überall online lernen können.','2022-08-25 13:43:24','2022-08-30 08:15:58',5),
	(2326,0,'de_DE','lptcontroller','region.title_green','Wir haben eine Lösung für alle!','2022-08-25 13:44:00','2022-08-30 08:17:32',5),
	(2327,0,'de_DE','lptcontroller','region.text_green','evulpo richtet sich sowohl an Schüler:innen als auch an Eltern und Lehrpersonen. Schluss mit dem Stress, online nach dem Video oder der Zusammenfassung suchen zu müssen, die dem entspricht, was im Unterricht besprochen wurde. Evulpo ist für jedes Bundesland und jedes Schuljahr ab der 3. Klasse geeignet.','2022-08-25 13:44:40','2022-08-30 08:17:40',5),
