	(2376,0,'de_DE','report','motivationquote.body.1','“Was ist ein gebildeter Mensch?”, fragte der Philosoph Robert Spaemann mal. Seine Antwort: Ein Mensch, der nicht nur auf sich, sondern auch auf die Welt schaut - und an dieser interessiert ist.','2022-08-25 14:49:00','2022-08-25 14:49:00',5),
	(2377,0,'de_DE','report','motivationquote.body.2','Doch sollte man sich von Zeit zu Zeit daran erinnern, dass wirklich Wissenswertes nicht gelehrt werden kann. [Oscar Wilde]','2022-08-25 14:51:56','2022-08-25 15:09:12',5),
	(2378,0,'de_DE','report','motivationquote.title.3','Übung macht den Meister..','2022-08-25 15:12:10','2022-08-25 15:12:10',5),
	(2379,0,'de_DE','report','motivationquote.body.3','Sprichworte sind deshalb so beliebt, weil sie immer ein Körnchen Wahrheit enthalten. So ist es auch bei diesem: Meisterhaft werden bei einer Tätigkeit kann man nur, wenn man die Tätigkeit regelmässig übt.','2022-08-25 15:12:42','2022-08-25 15:12:42',5),
	(2380,0,'de_DE','report','motivationquote.title.4','Bildung und Neugierde','2022-08-25 15:13:41','2022-08-25 15:13:41',5),
	(2381,0,'de_DE','report','motivationquote.body.4','Bildung beginnt mit Neugierde, hat der Schweizer Philosoph Peter Bieri gesagt. Wer keine Neugierde hat… wird sich nie bilden. Bleib also neugierig!','2022-08-25 15:14:12','2022-08-25 15:14:12',5),
	(2382,0,'de_DE','report','motivationquote.title.5','Auch Fussballer haben Köpfchen!','2022-08-25 15:14:52','2022-08-25 15:14:52',5),
	(2383,0,'de_DE','report','motivationquote.body.5','Der Schweizer Innenverteidiger Manuel Akanji kann fast jede Kopfrechnung (auch zum Beispiel 1238 + 2834 - 238) innerhalb von zwei Sekunden lösen. Sein Geheimnis: Übung! Vielleicht machst Du es ihm nach?','2022-08-25 15:15:41','2022-08-25 15:15:41',5),
	(2384,0,'de_DE','report','motivationquote.title.6','Emmanuel Macron? Ein Philosoph? Der gerne liest?','2022-08-25 15:16:14','2022-08-25 15:16:14',5),
	(2385,0,'de_DE','report','motivationquote.body.6','Der französische Präsident hat Philosophie studiert und sich dabei sehr intensiv mit französischer Literatur beschäftigt. Lesen, lesen, lesen, das ist also die Devise! Womöglich wirst Du dann auch mal Präsident? Oder Präsidentin?','2022-08-25 15:16:55','2022-08-25 15:16:55',5),
	(2386,0,'de_DE','report','motivationquote.title.7','Cristiano Ronaldo, der Tischtennis-Star','2022-08-25 15:17:29','2022-08-25 15:17:29',5),
	(2387,0,'de_DE','report','motivationquote.body.7','Als Cristiano Ronaldo zum ersten Mal Tischtennis gespielt hat, gab es eine Niederlage. Seine Reaktion: Drei Tage Tischtennis-Training am Stück. Das Ergebnis: Er hat nie mehr verloren. Was lernen wir daraus? Stets weiterlernen!','2022-08-25 15:18:01','2022-08-25 15:18:01',5),
	(2388,0,'de_DE','report','motivationquote.title.8','Albert Einstein','2022-08-25 15:18:30','2022-08-25 15:18:30',5),
	(2389,0,'de_DE','report','motivationquote.body.8','Schüler, die nicht so gute Noten haben, verweisen gerne auf ein Gerücht: Auch Albert Einstein sei ein schlechter Schüler gewesen. Die Wahrheit ist: Einstein war ein sehr guter Schüler. Wenn er eine schlechte Note hatte, so reagierte er mit Lerneinheiten - er wollte das nächste Mal eine bessere Note…','2022-08-25 15:19:01','2022-08-25 15:19:01',5),
	(2390,0,'de_DE','report','motivationquote.title.9','Schule ohne Noten?','2022-08-25 15:19:31','2022-08-25 15:19:31',5),
	(2391,0,'de_DE','report','motivationquote.body.9','Es gibt Bewegungen, die sich für die Abschaffung der Noten einsetzen. Die schlechte Nachricht für (prüfungsmüde) Schülerinnen und Schüler: Es sieht nicht danach aus, dass Noten bald abgeschafft werden. Also! Weiterhin versuchen, gute Noten zu holen…','2022-08-25 15:20:01','2022-08-25 15:20:01',5),
	(2392,0,'de_DE','report','motivationquote.title.10','Artes liberales','2022-08-25 15:20:36','2022-08-25 15:20:36',5),
	(2393,0,'de_DE','report','motivationquote.body.10','In der Antike gab es nur sieben Studienfächer - die sogenannten “Artes liberales”: Grammatik, Rhetorik, Dialektik, Arithmetik, Geometrie, Musik und Astronomie.  Vor allem mit diesen sieben Dingen beschäftigten sich Lernende. Zum Glück, so möchte man sagen, kann man heute auch anderes lernen!','2022-08-25 15:21:50','2022-08-25 15:21:50',5),
	(2394,0,'de_DE','report','motivationquote.title.11','Donald Trump und das Bücherlesen…','2022-08-25 15:22:25','2022-08-25 15:22:25',5),
	(2395,0,'de_DE','report','motivationquote.body.11','Einem Gerücht zufolge hat Donald Trump noch nie ein Buch zu Ende gelesen. Ob’s stimmt? So jedenfalls solltest Du nicht enden… Gebildet sind nur die, die ab und an einen Text zur Hand nehmen.','2022-08-25 15:23:20','2022-08-25 15:23:20',5),
	(2396,0,'de_DE','report','motivationquote.title.12','Gute Kommunikationsfähigkeiten','2022-08-25 15:23:55','2022-08-25 15:23:55',5),
	(2397,0,'de_DE','report','motivationquote.body.12','Wer sich in einem Bewerbungsbrief sehr präzise ausdrücken kann, der hat viel - viel! - bessere Chancen auf ein Vorstellungsgespräch als ein kommunikativer Banause. Schreibfähigkeiten sind also sehr wichtige Fähigkeiten. Heute also schon geschrieben?','2022-08-25 15:24:44','2022-08-25 15:24:44',5),
	(2398,0,'de_DE','report','motivationquote.title.13','Mathe ohne Ende','2022-08-26 07:10:49','2022-08-26 07:10:49',5),
	(2399,0,'de_DE','report','motivationquote.body.13','Fast in allen Ländern der Welt ist Mathematik das wichtigste Schulfach. Für kein anderes Fach wendet man so viele Wochenstunden auf wie für Mathe - typischerweise ca. sechs bis acht Stunden pro Woche. Insofern: Man hat nie zu wenig Mathe gelernt…!','2022-08-26 07:11:20','2022-08-26 07:11:20',5),
	(2400,0,'de_DE','report','motivationquote.title.14','Immer diese Kommas…','2022-08-26 07:11:51','2022-08-26 07:11:51',5),
	(2401,0,'de_DE','report','motivationquote.body.14','Die meisten Schreibfehler gibt es nicht wegen Problemen mit Gross- oder Kleinschreibung (oder ähnlichen Problemen), sondern wegen den Satzzeichen. Kommafehler - ein Klassiker! Also: Hör nie auf, Dich mit den Satzzeichen zu beschäftigen…','2022-08-26 07:12:21','2022-08-26 07:12:21',5),
	(2402,0,'de_DE','report','motivationquote.title.15','Nachhilfe','2022-08-26 07:12:54','2022-08-26 07:12:54',5),
	(2403,0,'de_DE','report','motivationquote.body.15','Rund jede/r zweite Schüler/in nimmt Nachhilfe, dies entweder in einem Nachhilfeinstitut oder bei einer Person aus der Nachbarschaft. Nachhilfe ist also ganz normal und sozusagen Standard - alle brauchen ab und an Extrahilfe.','2022-08-26 07:13:30','2022-08-26 07:13:30',5),
	(2404,0,'de_DE','report','motivationquote.title.16','Vier Landessprachen in der Schweiz','2022-08-26 07:13:59','2022-08-26 07:13:59',5),
	(2405,0,'de_DE','report','motivationquote.body.16','Viele Deutsche glauben, dass es in der Schweiz drei Landessprachen gibt, nämlich Deutsch, Französisch und Italienisch. Es gibt allerdings vier, nämlich auch noch Rätoromanisch - vor allem in gewissen Dörfern des Kantons Graubünden spricht man dies.','2022-08-26 07:14:30','2022-08-26 07:14:30',5),
	(2406,0,'de_DE','report','motivationquote.title.17','Napoleon und Goethe','2022-08-26 07:14:58','2022-08-26 07:14:58',5),
	(2407,0,'de_DE','report','motivationquote.body.17','Als Goethe (einer der wichtigsten Dichter überhaupt) im Jahre 1808 auf Napoleon (einer der wichtigsten Staatsmänner überhaupt) traf, sagte Napoleon zu Goethe bei der Begrüssung: “Vous êtes un homme!” “Sie sind ein Mann!” Goethe war sehr stolz auf diese Begrüssung - in seinem späteren Leben sprach er immer wieder davon.','2022-08-26 07:15:28','2022-08-26 07:15:28',5),
	(2408,0,'de_DE','report','motivationquote.title.18','Coldplay und der Geschichtsunterricht','2022-08-26 07:15:57','2022-08-26 07:15:57',5),
	(2409,0,'de_DE','report','motivationquote.body.18','Die Sänger der englischen Band Coldplay - einer der erfolgreichsten Bands der letzten Jahrzehnte - hat Geschichte studiert. Viele Texte der Band behandeln auch historische Themen.','2022-08-26 07:16:40','2022-08-26 07:16:40',5),
	(2410,0,'de_DE','report','motivationquote.title.19','Galileo Galilei glaubte an Engel','2022-08-26 07:17:12','2022-08-26 07:17:12',5),
	(2411,0,'de_DE','report','motivationquote.body.19','Galileo Galilei gilt als einer der Begründer der modernen Wissenschaft. Was viele nicht wissen: Der Physiker, Mathematiker und Philosoph glaubte, dass die Erde auch von Engeln bewohnt wird.','2022-08-26 07:17:43','2022-08-26 07:17:43',5),
	(2412,0,'de_DE','report','motivationquote.title.20','Zur Geschichte der Schule','2022-08-26 07:18:11','2022-08-26 07:18:11',5),
	(2413,0,'de_DE','report','motivationquote.body.30','Die Schulpflicht wurde in vielen Ländern des europäischen Kontinents im Laufe des 19. Jahrhunderts eingeführt. Seit rund 200 Jahren also müssen junge Menschen in die Schule gehen…','2022-08-26 07:18:41','2022-08-26 07:18:41',5),
	(2414,0,'de_DE','report','motivationquote.title.21','Latein am Gymnasium','2022-08-26 07:19:11','2022-08-26 07:19:11',5),
	(2415,0,'de_DE','report','motivationquote.body.21','Früher war es fast an jedem Gymnasium obligatorisch, dass die Schülerinnen und Schüler Latein lernen. Heute muss man nur noch an ca. 5% der Gymnasien Latein lernen. Die Sprache der alten Römer stirbt damit endgültig aus.','2022-08-26 07:20:08','2022-08-26 07:20:08',5),
	(2416,0,'de_DE','report','motivationquote.body.20','Die Schulpflicht wurde in vielen Ländern des europäischen Kontinents im Laufe des 19. Jahrhunderts eingeführt. Seit rund 200 Jahren also müssen junge Menschen in die Schule gehen…','2022-08-26 07:20:38','2022-08-26 07:20:38',5),
